import classes from "./ValueBoxes.module.css";

const ValueBoxes = (props) => {
  var isMutable = props.readOnly;
  var values = props.values ? props.values : Array(4).fill("");
  return (
    <div className={classes.box}>
      <input type="text" readOnly={isMutable} defaultValue={values[0]} className={classes.input}/>
      <input type="text" readOnly={isMutable} defaultValue={values[1]} className={classes.input}/>
      <input type="text" readOnly={isMutable} defaultValue={values[2]} className={classes.input}/>
      <input type="text" readOnly={isMutable} defaultValue={values[3]} className={classes.input}/>
    </div>
  );
};

export default ValueBoxes;
